import React from 'react';
import { connect } from 'react-redux';

const ImageMain = (props) => {
  console.log(this.props);
  return(
    <div>
        Image here
    </div>
  );
};

const mapStateToProps = state => {
  return {
    url: state.url
  };
};

export default connect(mapStateToProps, {})(ImageMain);
